import "./ExpensesList.css";
import ExpenseItem from "./ExpenseItem";

const ExpensesList = props => {
  {props.filter(expense => (parseInt(selectedOption)===expense.date.getFullYear())).map((expense) => {
    return (
      <ExpenseItem 
        key={expense.id}
        title={expense.title} 
        amount={expense.amount}
        date={expense.date}
      />
    )
  })}
}
